package lec_20;

public class timecomplexity {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
         int n=6;
         int count =0;
         for(int i=0;i<n;i++) {
        	 for(int j=0;j<n;j++) {
        		 count ++;
        	 }
        	 
         }
         System.out.println(count);
         
	}

}
